INSERT INTO `rpjm` VALUES ('1', '2013-2018', 'Terwujudnya birokrasi sehat, masyarakat kuat dan lingkungan bersahabat demi tercapainya Kabupaten Sampang yang Bermartabat');
INSERT INTO `rpjm_misi` VALUES ('1', '1', 'Mewujudkan Tata Kelola Pemerintahan yang Baik dan Profesional', 'Pemerintahan yang responsif terhadap perubahan lingkungan strategis dan berorientasi pada kepentingan masyarakat. Perbaikan/Penyempurnaan menyangkut aspek kelembagaan, manajemen sumber daya manusia, sistem dan prosedur baik pada tingkat Pemerintah Kabupaten Sampang maupun Satuan Kerja Perangkat Daerah');
INSERT INTO `rpjm_misi` VALUES ('2', '1', 'Meningkatkan Pelayanan Dasar yang Berkualitas dan Terjangkau', 'Upaya Pemerintah Kabupaten Sampang untuk memenuhi layanan dasar yang berkualitas dan terjangkau yang menjadi hak masyarakat, khususnya layanan pendidikan, kesehatan, dan penyediaan infrastruktur. Berbagai program pembangunan yang telah dilaksanakan selama ini belum sepenuhnya berhasil memberikan pelayanan dasar tersebut secara merata dan berkeadilan, baik dari aspek kuantititas maupun kualitas sehingga upayaupaya peningkatan perlu dilakukan secara berkelanjutan.');
INSERT INTO `rpjm_misi` VALUES ('3', '1', 'Meningkatkan Pertumbuhan Ekonomi yang Berkualitas', 'Pembangunan pada bidang perekonomian daerah bersifat simultan dan sinergis antara upaya-upaya meningkatkan pertumbuhan yang tinggi dan pemerataan. Upaya-upaya dalam memperbesar kapasitas perekonomian daerah (pertumbuhan yang tinggi) dilakukan bersamaan dengan upaya-upaya pemerataan manfaatnya bagi masyarakat');
INSERT INTO `rpjm_misi` VALUES ('4', '1', 'Meningkatkan Pertumbuhan Ekonomi yang Berkualitas', 'Pembangunan pada bidang perekonomian daerah bersifat simultan dan sinergis antara upayaupaya meningkatkan pertumbuhan yang tinggi dan pemerataan. Upayaupaya dalam memperbesar kapasitas perekonomian daerah (pertumbuhan yang tinggi) dilakukan bersamaan dengan upayaupaya pemerataan manfaatnya bagi masyarakat');
INSERT INTO `rpjm_misi` VALUES ('5', '1', 'Meningkatkan partisipasi masyarakat dalam penyelenggaraan pemerintahan dan pembangunan', 'Kemampuan masyarakat berpartisipasi aktif (khususnya dalam perumusan dan penetapan kebijakan publik) sehingga penyelenggaraan pemerintahan dan pembangunan mencerminkan representasi kebutuhan dan/atau kesepakatan bersama');
INSERT INTO `rpjm_visi` VALUES ('1', '1', 'Birokrasi sehat', 'Birokrasi yang mampu melaksanakan fungsifungsinya untuk mencapai tujuan dan sasaran yang ditetapkan secara efektif, efisien, dan ekonomis');
INSERT INTO `rpjm_visi` VALUES ('2', '1', 'Masyarakat kuat', 'Masyarakat yang memiliki kemandirian secara sosial dan ekonomi, serta senantiasa mampu beradaptasi dengan terjadinya perubahan lingkungan strategis (pada tingkat tertentu, mampu menjadi subyek dari perubahan)');
INSERT INTO `rpjm_visi` VALUES ('3', '1', 'Lingkungan bersahabat', 'Lingkungan fisik dan non fisik yang mendukung terwujudnya peri kehidupan yang aman dan nyaman sehingga setiap elemen masyarakat dapat mengembangkan potensi dan kapasitasnya. ');
INSERT INTO `rpjm_visi` VALUES ('4', '1', 'Bermartabat', 'Harkat atau harga diri yang mencerminkan eksistensi setiap elemen dari Masyarakat Sampang yang menjunjung ketaatan dan kedisiplinan terhadap ketentuan hukum, nilainilai etika dan ketaqwaan kepada Tuhan Yang Maha Esa');
